import React, { Component } from "react";
import { Row, Col } from "reactstrap";
import CategoryList from "../homes/HomeList";
import HomeList from "../homes/HomeList";

export default class Dashboard extends Component {
  render() {
    return (
      <div>
        <Row>
          <Col xs="3">
            <CategoryList />
          </Col>
          <Col xs="9">
            <HomeList />
          </Col>
        </Row>
      </div>
    );
  }
}
